import React, { Component } from 'react'
import './Nav_top.css';
import { Nav, NavbarContainer, NavLogo} from "./NavbarElements";


export default class Nav_Top extends Component {
    render() {
        return (
            <>
                <Nav>
                    <NavbarContainer>
                        <NavLogo to="/">

                        </NavLogo>

                    </NavbarContainer>

                </Nav>
            </>
        )
    }
}
